import React from 'react';
import { BrowserRouter as Router } from "react-router-dom";

import Header from './components/Header';
import './App.css';
import Routes from './Routes';

import axios from "axios";

function App() {

	const xdd = async ()=> {
		const xd:any = await fetch("https://localhost:4000/api/users");
		console.log(xd);
	}
	xdd();

  return (
    <Router>
      <div className="App">
        <Header/>
        <Routes/>
      </div>
    </Router>
  );
}

export default App;
